import React, { useEffect } from 'react';

function App() {
  useEffect(() => {
    fetch("http://localhost:3000/materials")
    .then(r => {
      if (r.status) return r.json()
    })
    .then(data => console.log(data))
    .catch((err) => alert(err.message))
  }, [])

  return (
    <div>
      <h1>NavBar</h1>
      <h1>Dashboard</h1>
      <h1>Contact</h1>
      <h1>ItemManager</h1>
      <h1>ViewItemDetail</h1>
    </div>
  );
}

export default App;
